import React from "react";
import "./styles.scss";
import strings from "../../en-NZ";
import ContentImageBlock from "../../components/ContentImageBlock/ContentImageBlock";

const content = [
  strings.about.iam,
  strings.about.recent,
  strings.about.self,
  strings.about.check,
];

const AboutSection = () => {
  return (
    <div className="about">
      <ContentImageBlock />
    </div>
  );
};

export default AboutSection;
